import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ProjectCard = ({ project }) => {
    return (
        <div className="flip-card-container">
            <div className="flip-card">
                <div className="card-front">
                    <figure>
                        <div className="img-bg"></div>
                        <img src={`https://source.unsplash.com/random/900*700/?night&${project.id}`} alt="Project" />
                        <figcaption>{project.title}</figcaption>
                    </figure>
                    <ul>
                        <li>
                            <div className="heading">Project Technologies</div>
                            <div className="ans">{project.tech}</div>
                        </li>
                        <li>
                            <div className="heading">Technical_Skillset.Frontend</div>
                            <div className="ans">{project.frontend}</div>
                        </li>
                        <li>
                            <div className="heading">Technical_Skillset.Backend</div>
                            <div className="ans">{project.backend}</div>
                        </li>
                        <li>
                            <div className="heading">Technical_Skillset.Database</div>
                            <div className="ans">{project.db || 'Not specified'}</div>
                        </li>
                        <li>
                            <div className="heading">Technical_Skillset.Infrastructure</div>
                            <div className="ans">{project.infra || 'Not specified'}</div>
                        </li>
                    </ul>
                </div>
                <div className="card-back">
                    <figure>
                        <div className="img-bg"></div>
                        <img src={`https://source.unsplash.com/random/900*700/?night&${project.id}`} alt="Project" />
                    </figure>
                    <button>Book</button>
                    <div className="design-container">
                        <span className="design design--1"></span>
                        <span className="design design--2"></span>
                        <span className="design design--3"></span>
                        <span className="design design--4"></span>
                        <span className="design design--5"></span>
                        <span className="design design--6"></span>
                        <span className="design design--7"></span>
                        <span className="design design--8"></span>
                    </div>
                </div>
            </div>
        </div>
    );
};

const ProjectList = () => {
    const apiUrl = 'https://c80c-182-79-4-248.ngrok-free.app';
    const [projects, setProjects] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        axios
            .get(apiUrl)
            .then((response) => {
                setProjects(response.data);
                setLoading(false);
            })
            .catch((err) => {
                console.error('Error fetching data:', err);
                setError('An error occurred while fetching data.');
                setLoading(false);
            });
    }, []);

    return (
        <div className="container">
            {loading ? (
                <p>Loading...</p>
            ) : error ? (
                <p>{error}</p>
            ) : (
                projects.map((project) => <ProjectCard key={project.id} project={project} />)
            )}
        </div>
    );
};

export default ProjectList;
